    constructor(props) {
        super(props);
        this.state={TVShowslist:[]}
    }
    componentDidMount() {
        axios.get('http://localhost:3000/Movies')
            .then(response => {
                this.setState({ todos: response.data });
            })
            .catch(function (error){
                console.log(error);
            })
    }
      render() {
            return (
              <button style={buttonStyle} onClick={(e) => {
                                  e.preventDefault();
                                  //window.location.href='./Movies'
